webpackJsonp([0xd8f1f68bda98],{5176:function(e,t){e.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/12/crhxmas2000.jpg" /></p>\n<p>from Christopher and his parents</p>\n<p>Our plans for the day are pretty much the same as <a href="/1999/12/24">last year</a>, except that our evening meal will be quesadillas instead of raclette.</p>\n<p>I\'m writing this paragraph with the ThinkPad from our kitchen. There\'s a phone jack there, so I can connect to T-Offline (as long as the LAN upstairs is offline... the <a href="http://www.t-online.de">big pink T</a> doesn\'t want me logging on twice).</p>',fields:{title:"Merry Christmas",date:"24 Dec 2000",url:"https://papascott.de/2000-12-24-merry-christmas/"}}},pathContext:{slug:"/2000-12-24-merry-christmas/",prev:{fields:{title:"Final Sprint",date:"21 Dec 2000",slug:"/2000-12-21-final-sprint/"}},next:{fields:{title:"Merry Boxing Day",date:"26 Dec 2000",slug:"/2000-12-26-merry-boxing-day/"}}}}}});
